    for i in range(n):
        for j in range(m):
            if maze[i][j] == 'X':
                start_pos = [i, j]
                break
    maze[start_pos[0]][start_pos[1]] = '.'
    visited = set()
    queue = [(start_pos, 'L')]
    while queue:
        (i, j), way = queue.pop(0)
        if (i, j) in visited:
            continue
        visited.add((i, j))
        if len(way) == k:
            return way
        for move in ['L', 'R', 'U', 'D']:
            ni, nj = i, j
            if move == 'L':
                ni -= 1
            elif move == 'R':
                ni += 1
            elif move == 'U':
                nj -= 1
            else:
                nj += 1
            if 0 <= ni < n and 0 <= nj < m and maze[ni][nj] == '.' and (ni, nj) not in visited:
                queue.append(((ni, nj, way + move))
    return 'IMPOSSIBLE'

