class Graph:
    def __init__(self, n, m):
        self.n = n
        self.edges = [(1, 2)]
        for i in range(3, n+1):
            self.edges.append((i-1, i))
        self.m = m
    def is_valid(self):
        if len(self.edges) != self.m:
            return False
        for i in range(self.n):
            if not is_prime(self.degree(i)):
                return False
        return True
    def degree(self, i):
        count = 0
        for edge in self.edges:
            if i in edge:
                count += 1
        return count
    def add_edge(self, u, v):
        if u == v:
            return
        self.edges.append((u, v))
        self.m -= 1
    def remove_edge(self, u, v):
        if (u, v) in self.edges:
            self.edges.remove((u, v)
        else:
            self.edges.remove((v, u)
        self.m += 1

def is_prime(n):
    if n < 2:
