def solution(input_string):

    n, k, s, t = map(int, input_string.split())
    cars = []
    for _ in range(n):
        c, v = map(int, input_string.split())
        cars.append((c, v))
    gas_stations = list(map(int, input_string.split()))

    def distance_traveled(car, mode):
        if mode == 'normal':
            return car[1] * 2 * (s // 2)
        else:
            return car[1] * 2 * (s // 2) + car[1]

    def fuel_needed(mode):
        if mode == 'normal':
            return s // 2
        else:
            return s

    def min_price(car_index):
        car = cars[car_index]
        min_price = float('inf')
        for i in range(k):
            gas_station = gas_stations[i]
            if gas_station >= car[1]:
                continue
            normal_mode_time = distance_traveled(car, 'normal') / (car[1] - gas_station) + car[1]
            accelerated_mode_time = distance_traveled(car, 'accelerated') / (car[1] - gas_station) + car[1]
            if normal_mode_time <= t and accelerated_mode_time <= t:
                min_price = min(min_price, car[0])
        return min_price

    for car_index in range(n):
        min_price_car = min_price(car_index)
        if min_price_car != float('inf'):
            return min_price_car
    return -1

