        frequency = {}
        for char in s:
            if char in frequency:
                frequency[char] += 1
            else:
                frequency[char] = 1
        # create a new string with each character sorted by frequency
        sorted_string = ''.join(sorted(s, key=lambda x: frequency[x], reverse=True))
        # loop through the sorted string and keep track of the current index and last index of each character
        # if the current character has already been used, move to the next one. if not, insert it and update the last index
        result = ''
        used = {}
        index = {}
        for char in sorted_string:
            if char in used:
                continue
            else:
                used[char] = True
                index[char] = 0
        for char in s:
            if char in used:
                result += char
                index[char] += 1
                if index[char] >= frequency[char]:
                    del used[char]
                    del index[char]
        if len(used) > 0:
            print("No answer")
