def match(pattern, file):
    i = j = 0
    n = len(pattern)
    m = len(file)
    while i < n and j < m:
        if pattern[i] == '*':
            while i < n:
                if i+1 < n and pattern[i+1] == '*':
                    return False
                if file[j:j+n-i].startswith(pattern[i:]):
                    return True
                j += 1
            return False
        elif pattern[i] == '.' or pattern[i] == file[j] or pattern[i] == '?':
            i += 1
            j += 1
        else:
            return False
    return i == n and j == m

