    socks_dict = {}
    for sock in socks:
        if sock in socks_dict:
            socks_dict[sock] += 1
        else:
            socks_dict[sock] = 1

    # create two piles, one for odd types, one for even types
    odd_pile, even_pile = [], []
    for key, value in socks_dict.items():
        if key % 2 == 0:
            even_pile.extend([key] * value)
        else:
            odd_pile.extend([key] * value)

    # start counting the moves
    moves = 0

    # if the number of socks in odd_pile is not even, impossible to pair
    if len(odd_pile) % 2 != 0:
        return "impossible"

    while len(odd_pile) != 0:
        # move socks from odd pile to even pile
        for _ in range(len(odd_pile) // 2):
            moves += 2
            even_pile.append(odd_pile.pop())
            even_pile.append(odd_pile.pop())
        # pair socks from even pile
        for _ in range(len(even_pile) // 2):
            moves += 2
            even_pile.pop()
            even_pile.pop()

    return moves

